import React from 'react';
import RecipeContextProvider from './context/RecipeContext'
import HomePage from './pages/HomePage';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'

function App() {
  return (
    <RecipeContextProvider>
      <Router>
        <Route exact path="/">

          <HomePage />
        </Route>
      </Router>


    </RecipeContextProvider>

  );
}

export default App;
